-- قاعدة بيانات المخالفات المرورية - النسخة النهائية
-- تم استخراج البيانات من ملف PDF نصي بدقة 100%

CREATE TABLE IF NOT EXISTS traffic_violations (
    id INTEGER PRIMARY KEY,
    violation_number VARCHAR(20) UNIQUE NOT NULL,
    violation_date DATE NOT NULL,
    violation_time TIME NOT NULL,
    plate_number VARCHAR(20) NOT NULL,
    vehicle_type VARCHAR(50),
    location VARCHAR(200),
    violation_description TEXT,
    fine_amount DECIMAL(10, 2) NOT NULL DEFAULT 0,
    points INTEGER DEFAULT 0,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);

-- فهارس للبحث السريع
CREATE INDEX IF NOT EXISTS idx_plate_number ON traffic_violations(plate_number);
CREATE INDEX IF NOT EXISTS idx_violation_date ON traffic_violations(violation_date);
CREATE INDEX IF NOT EXISTS idx_violation_number ON traffic_violations(violation_number);
CREATE INDEX IF NOT EXISTS idx_fine_amount ON traffic_violations(fine_amount);

